import React, { useEffect, useRef, useState } from 'react';
import {
    UserGroupIcon,
    RocketLaunchIcon,
    MagnifyingGlassIcon
} from '@heroicons/react/24/outline';

const ValueCard = ({ icon: Icon, title, description, delay = 0 }) => {
    const [isVisible, setIsVisible] = useState(false);
    const cardRef = useRef(null);

    useEffect(() => {
        const observer = new IntersectionObserver(
            ([entry]) => {
                if (entry.isIntersecting) {
                    setTimeout(() => setIsVisible(true), delay);
                }
            },
            { threshold: 0.1 }
        );

        if (cardRef.current) {
            observer.observe(cardRef.current);
        }

        return () => observer.disconnect();
    }, [delay]);

    return (
        <div
            ref={cardRef}
            className={`bg-white border border-gray-200 rounded-lg p-6 shadow-sm hover:shadow-md transition-all duration-500 ${isVisible ? 'opacity-100 translate-y-0' : 'opacity-0 translate-y-4'
                }`}
        >
            <div className="mb-4">
                <Icon className="w-8 h-8 text-blue-600" />
            </div>
            <h3 className="text-xl font-semibold text-gray-900 mb-3">
                {title}
            </h3>
            <p className="text-gray-600 leading-relaxed">
                {description}
            </p>
        </div>
    );
};

const ValueSection = () => {
    const [titleVisible, setTitleVisible] = useState(false);
    const [dashboardVisible, setDashboardVisible] = useState(false);
    const titleRef = useRef(null);
    const dashboardRef = useRef(null);

    useEffect(() => {
        const titleObserver = new IntersectionObserver(
            ([entry]) => {
                if (entry.isIntersecting) {
                    setTitleVisible(true);
                }
            },
            { threshold: 0.1 }
        );

        const dashboardObserver = new IntersectionObserver(
            ([entry]) => {
                if (entry.isIntersecting) {
                    setTimeout(() => setDashboardVisible(true), 200);
                }
            },
            { threshold: 0.1 }
        );

        if (titleRef.current) titleObserver.observe(titleRef.current);
        if (dashboardRef.current) dashboardObserver.observe(dashboardRef.current);

        return () => {
            titleObserver.disconnect();
            dashboardObserver.disconnect();
        };
    }, []);

    const values = [
        {
            icon: UserGroupIcon,
            title: "Understand your audience",
            description: "Gain deep insights into visitor behaviors from traffic sources to engagement, our AI helps you connect with audience"
        },
        {
            icon: RocketLaunchIcon,
            title: "Optimize website speed",
            description: "Our AI pinpoints bottlenecks and suggests real-time fixes to ensure your pages load lightning-fast."
        },
        {
            icon: MagnifyingGlassIcon,
            title: "Boost search ranking",
            description: "Our AI analyzes your site and provides actionable recommendations to improve visibility."
        }
    ];

    return (
        <section id="key-values" className="py-20 bg-gray-50">
            <div className="container mx-auto px-4 sm:px-6 lg:px-8">
                {/* Header */}
                <div
                    ref={titleRef}
                    className={`text-center mb-16 transition-all duration-1000 ${titleVisible ? 'opacity-100 translate-y-0' : 'opacity-0 translate-y-4'
                        }`}
                >
                    <p className="text-gray-600 text-sm font-medium uppercase tracking-wide mb-4">
                        Our key values
                    </p>
                    <h2 className="text-3xl sm:text-4xl lg:text-5xl font-bold text-gray-900 mb-6">
                        Your trusted companion.
                        <br />
                        Transforming exploration and innovation
                    </h2>
                </div>

                {/* Value Cards */}
                <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8 mb-20">
                    {values.map((value, index) => (
                        <ValueCard
                            key={index}
                            icon={value.icon}
                            title={value.title}
                            description={value.description}
                            delay={index * 200}
                        />
                    ))}
                </div>

                {/* Dashboard Section */}
                <div className="text-center">
                    <div
                        ref={dashboardRef}
                        className={`mb-12 transition-all duration-1000 ${dashboardVisible ? 'opacity-100 translate-y-0' : 'opacity-0 translate-y-4'
                            }`}
                    >
                        <p className="text-gray-600 text-sm font-medium uppercase tracking-wide mb-4">
                            Welcome guys
                        </p>
                        <h2 className="text-3xl sm:text-4xl lg:text-5xl font-bold text-gray-900 mb-6">
                            Save time and money with us
                        </h2>
                        <p className="text-lg text-gray-600 max-w-3xl mx-auto">
                            Experience the power of the Intelly Dashboard â€“ an intuitive platform
                            that centralizes your website's analytics.
                        </p>
                    </div>

                    {/* Dashboard Image */}
                    <div
                        className={`relative max-w-6xl mx-auto transition-all duration-1000 delay-300 ${dashboardVisible ? 'opacity-100 translate-y-0' : 'opacity-0 translate-y-6'
                            }`}
                    >
                        <div className="bg-gradient-to-br from-blue-50 to-indigo-100 rounded-2xl p-4 shadow-2xl">
                            <img
                                src="https://framerusercontent.com/images/JlBhIyZ0rNmES7pVD12rXAPbQJ0.png"
                                alt="Intelly Dashboard"
                                className="w-full h-auto rounded-xl shadow-lg"
                            />
                        </div>

                        {/* Decorative Elements */}
                        <div className="absolute -top-4 -left-4 w-8 h-8 bg-blue-500 rounded-full opacity-20 animate-pulse"></div>
                        <div className="absolute -bottom-4 -right-4 w-12 h-12 bg-purple-500 rounded-full opacity-20 animate-pulse delay-1000"></div>
                    </div>
                </div>

                {/* Bottom Divider */}
                <div className="mt-20 flex justify-center">
                    <div className="w-24 h-px bg-gray-300"></div>
                </div>
            </div>
        </section>
    );
};

export default ValueSection;
